import React, { Fragment } from 'react';
import ReactDOM from 'react-dom';
import './index.css';

function Title() {
    return (
        <div className='title'>
            The Title
        </div>
    )
}

function Author() {
    return (
        <div className='author'>
            The Author
        </div>
    )
}

function List() {
    return (
        <>
            <li className='rating'>
                5 star
            </li>
            <li className='isbn'>
                12-837777378
            </li>
        </>
    )
}

function App() {
    return(
        <div>
            <div className='book'>
                <Title/>
                <Author/>
                <ul className='stats'>
                    <List/>
                </ul>
                </div>
        </div>
    )
}

ReactDOM.render(<App/>, document.getElementById('root'));
